sys_variable_value.value:
(function execute(inputs, outputs) {
  try {
    var successStatusCodes = ['200'];
    var errorMessages = {
      'Project Not Found': 'Project ID not found.',
      'File Not Found': 'Invalid file path - not found.',
      'Commit Not Found': 'Invalid ref - commit not found.'
    };
    var callbackFunction = function(inputs, outputs, errorMessages) {
      var responseBody = JSON.parse(inputs.responseBody);
      outputs.file_content = gs.base64Decode(responseBody.content);
      outputs.size = responseBody.size;
      outputs.blob_id = responseBody.blob_id;
      outputs.commit_id = responseBody.commit_id;
      outputs.last_commit_id = responseBody.last_commit_id;
      return outputs;
    };
    outputs = new x_snc_gitlab.GitLabUtils().postProcess(inputs, outputs, errorMessages, successStatusCodes, callbackFunction);
  } catch (e) {
    outputs = new x_snc_gitlab.GitLabErrorHandler(e).handleError(inputs, outputs, errorMessages);
  }
})(inputs, outputs);

